var title_f40_12_41163="Indication RET mutation analysis";
var content_f40_12_41163=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ENDO%2F65295&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ENDO%2F65295&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Criteria for DNA-analysis for MEN2/FMTC",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        RET mutation analysis should be performed:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        In patients with:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        1. Clinically proven MEN2 syndrome: bilateral, multicentric MTC and/or pheochromocytoma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        2. MTC or pheochromocytoma and a family member with MTC or pheochromocytoma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        3. Apparently sporadic MEN2 related tumors and:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        a. Age younger than 35 years and/or",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        b. Multicentric tumors in one organ and/or",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        c. Two different organs affected",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        First and second degree family members of MEN2 patients",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        All patients with sporadic MTC ? (may have consequences for target-directed treatment)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from:",
"     <br>",
"      1. Lips C. Clinical manifestations and diagnosis of multiple endocrine neoplasia type 2. In: UpToDate, Basow, DS (Ed), UpToDate, Waltham, MA 2012.",
"      <br>",
"       2. Brandi ML, Gagel RF, Angeli A, et al. Guidelines for diagnosis and therapy of MEN type 1 and type 2. J Clin Endocrinol Metab 2001; 86:5658.",
"       <br>",
"        3. Machens A, Dralle H. Genotype-Phenotype Based Surgical Concept of Hereditary Medullary Thyroid Carcinoma. World J Surg 2007; 31:957.",
"        <br>",
"         4. Kloos RT, Eng C, Evans DB, et al. American Thyroid Association Guidelines Task Force, Medullary thyroid cancer: management guidelines of the American Thyroid Association. Thyroid 2009; 19:565. Comment in: Thyroid 2009; 19:543,547,551,555.",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
